import React from "react";

export default function Results(props) {
  console.log(props);
  return (
    <div className="Results">
      <div className="row">
        <div className="col-6">
          <h2>
            <span>Title: </span>
            {props.results.title}
          </h2>
          <h3>
            <span>Publishers: </span>
            {props.results.publishers}
          </h3>
        </div>
      </div>
    </div>
  );
}
